function afterProcessCreate(processId) {
    log.info('### uf-log | Início afterProcessCreate(processId: '+processId+') ###');

	// salva o número da solicitação no campo do formulário
	hAPI.setCardValue("PROTOCOLO", processId);
    
    // salva a data no campo do formulário
    var dtaHra = dataFormatada();
	hAPI.setCardValue('SOLICDATA', dtaHra);
	
    log.info('### uf-log | Final afterProcessCreate(processId: '+processId+') ###');
}

/**
 * @desc 	Retorna a Data e Hora atual no formato: DD/MM/AAAA hh:mm:ss 
 */
function dataFormatada() {
    var data = new Date(),
        dia = data.getDate(),
        mes = data.getMonth() + 1,
        ano = data.getFullYear(),
        hora = data.getHours(),
        minutos = data.getMinutes(),
        segundos = data.getSeconds();
    
    var dtaHra = '';
    dtaHra += [Number(dia).pad(), Number(mes).pad(), Number(ano).pad()].join('/');
    dtaHra += ' ';
    dtaHra += [Number(hora).pad(), Number(minutos).pad(), Number(segundos).pad()].join(':');
    
    return dtaHra;
}

/**
 * @desc 	Formata um número colocando @size zeros à esquerda  
 */
Number.prototype.pad = function (size) {
    var s = String(this);
    while (s.length < (size || 2)) {
        s = "0" + s;
    }
    return s;
}

function afterProcessFinish(processId){
	var atvAtual = getValue('WKCurrentState');
    log.dir('### uf-log | Início Treinamento_02.afterProcessFinish.js (atvAtual: ' + atvAtual + ') ###');
	
    // Lista com os possíveis status de finalizado
	var lstAtiv = {
        4: {
	    	tit: 'Solicitação Finalizada',
        },
        6: {
	    	tit: 'Solicitação Cancelada',
        },
	   
	};
	hAPI.setCardValue("STATUSCOD", atvAtual);
    hAPI.setCardValue("STATUS", lstAtiv[atvAtual].tit);
    log.info('### uf-log | Fim da Chamada do Treinamento_02.afterProcessFinish.js (atvAtual: ' + atvAtual + ' ###')
}

function beforeTaskSave(colleagueId, nextSequenceId, userList) {
    var atvAtual = getValue('WKCurrentState');
    log.info("Executou before")
    
    if (atvAtual == 1) {
        log.info("Executou condição")
        var campoValorTotal = hAPI.getCardValue("VALORTOTAL");
        var campoFormatado = parseReais(campoValorTotal);
        log.info("valor do campo agora");
        //log.info(campoValorTotal)
        
        if (campoFormatado > 100000) {
            log.info("atendeu condição valor total")
            throw "O valor total dos produtos não pode passar de R$ 100.000,00."
        }
    }
}
